const mongoose = require('mongoose')

const groupMessageSchema = new mongoose.Schema({
  messageText: {
    type: Object,
    default: "",
  },
  image: {
    type: Object,
    default: "",
  },
  video: {
    type: Object,
    default: "",
  },
  msgByUserID: {
    type: mongoose.Schema.ObjectId,
    required: true,
    ref: 'User'
  },
  seenBy: [
    {
      type: mongoose.Schema.Types.ObjectId,
      ref: 'User'
    }
  ],
}, {
  timestamps: true
})


const groupChatSchema = new mongoose.Schema({
  name: {
    type: String,
    default: ""
  },
  createdBy: {
    type: mongoose.Schema.ObjectId,
    required: true,
    ref: 'User'
  },
  profile_pic: {
    type: String,
    default: "data:image/png;base64,"
  },
  members: [
    {
      type: mongoose.Schema.ObjectId,
      ref: 'User'
    }
  ],
  public_key: {
    type: String,
    required: true
  },
  private_key: {
    type: String,
    required: true
  },
  messages: [
    {
      type: mongoose.Schema.ObjectId,
      ref: 'GroupMessage'
    }
  ]
}, {
  timestamps: true
})
const GroupMessageModel = mongoose.model('GroupMessage', groupMessageSchema)
const GroupChatModel = mongoose.model('GroupConversation', groupChatSchema)
module.exports = {
  GroupMessageModel,
  GroupChatModel
}